import React from "react";
import { Container, Nav, Navbar, NavDropdown } from "react-bootstrap";
import { useLocation } from "react-router";
import NavThemeSwitch from '../NavThemeSwitch';

const PlainNavBar = () => {

    const loggedIn = false;

    const location = useLocation();

    return (
        <Navbar expand="md" bg className="mb-2" style="background: var(--indigo);">
            <Container fluid>
                <Navbar.Brand href="./">
                    <strong>Mathforces<sub>Î²eta</sub></strong>
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="navbar-nav" />
                <Navbar.Collapse id="navbar-nav">
                    <Nav className="me-auto" activeKey={location.pathname}>
                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/ranking">Ranking</Nav.Link>
                        <Nav.Link href="/contestset">Contests</Nav.Link>
                        <Nav.Link href="/problemset">Problems</Nav.Link>
                        {
                            loggedIn ? (
                                <Nav.Link href="./manage">Manage</Nav.Link>
                            ) : (
                                null
                            )
                        }
                    </Nav>
                    <Nav className="mr-auto">
                        {
                            loggedIn ? (
                                <Nav.Link>Feuergas</Nav.Link>
                            ) : (
                                <NavDropdown title="Log In" id="login-dropdown">
                                    <NavDropdown.Item>Ciao</NavDropdown.Item>
                                    <NavDropdown.Item>a</NavDropdown.Item>
                                    <NavDropdown.Item>tutti</NavDropdown.Item>
                                </NavDropdown>
                            )
                        }
                        <NavThemeSwitch />
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
};

const RouterNavBar = PlainNavBar;

export default RouterNavBar;
